import Card from './Card'


export default function Cards({characters}) {
   // const { characters } = props;
   return (
      <div>
         {
            characters.map(({ name, species, gender, image, onClose }) => {
                <Card
                  name={name}
                  species={species}
                  gender={gender}
                  image={image}
                  onClose={() => window.alert('Emulamos que se cierra la card')}
               />
            })
         }
      </div>
   );


}
